    <script>
        var alert=new Alert();
        document.getElementById("grid").addEventListener("click",function(e){
            var target=e.target;
            if(target.tagName=="A"){
                var icon=target.querySelector("i");
            }else if(target.tagName=="I"){
                var icon=target;
            }else{
                return;
            }
            alert.setText(icon.className);
            alert.show();
        },false);
        //定义exmobi返回
        function back(){history.go(-1);}
    </script>
